@DempigFair, DLSS 4 (no frame Gen) is amazing in quality, and realistically for the review I've seen, would be impossible to spot while playing.

But, with a 7900xtx tier card, a bunch of newer games would still be more than playable without upscaling, and older games (which still look amazing) could be supersamples. Or VR.

Honestly, if AMD actually wants to increase their market share, say 750$ for a 7900xtx. It would absolutely destroy Nvidia current gen. Dlss is amazing, RT is niche. But the average gamer would probably go for a 7900xtx instead of s 4080 super / 5080.
